export default function(state=null, action){
    switch(action.type){
        case 'TASK_CHECKED':
            console.log('TASK_CHECKED');
            state = {
                status: 'Y'
            };
            break;
        case 'TASK_UNCHECKED':
            console.log('TASK_UNCHECKED');
            state = {
                status: 'N'
            };
            break;
    }
    return state;
}
